input_ontology:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix ont: <http://example.com/PlantOntology#> .

ont: rdf:type owl:Ontology ;
rdfs:label "plant-ontology" ;
.

ont:ONTPlant
rdf:type owl:Class ;
rdfs:label "ONT Plant"@en ;
rdfs:comment "Describes the Plant entity in the ONT data base."@en .

ont:plantName
rdf:type owl:DatatypeProperty ;
rdfs:label "plant name" ;
rdfs:range xsd:string ;
rdfs:domain ont:ONTPlant .

result_mappings:
@prefix rr: <http://www.w3.org/ns/r2rml#> .
@prefix rml: <http://semweb.mmlab.be/ns/rml#> .
@prefix ql: <http://semweb.mmlab.be/ns/ql#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix ont: <http://example.com/PlantOntology#> .

<#PlantMapping>
    a rr:TriplesMap ;
    rml:logicalSource [
        rml:source "examples/data.csv" ;
        rml:referenceFormulation ql:CSV
    ] ;

    rr:subjectMap [
        rr:template "http://example.com/PlantOntology#{PlantID}" ;
        rr:class ont:Plant
    ] ;

    rr:predicateObjectMap [
        rr:predicate ont:plantId ;
        rr:objectMap [
            rml:reference "PlantID"
        ]
    ] ;

    rr:predicateObjectMap [
        rr:predicate ont:plantName ;
        rr:objectMap [
            rml:reference "PlantName"
        ]
    ] .
